import React, { Component } from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import {faKeyboard,faPencilAlt} from '@fortawesome/fontawesome-free-solid'
class Personalchild extends Component{
 
    render(){

 
        return(
            <div className="cv-child">
<span><FontAwesomeIcon icon={this.props.icon} style={{color:"#494c6d"}}/></span>
<div>
<h6> {this.props.info}</h6>
<p>{this.props.data}</p>
</div>
                
            </div>
        )
    }

}
export default Personalchild
